use library;
CREATE TABLE `book` (
  `ISBN` varchar(15) NOT NULL,
  `TITLE` varchar(250) DEFAULT NULL,
  `AVAILABILITY` enum('YES','NO') NOT NULL DEFAULT 'YES',
  PRIMARY KEY (`ISBN`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



